function FullAdShow() {
  if (!canShowAd()) { sendYG('CloseInterAdv', 'false'); return; }

  try {
    if (nowFullAdOpen) return;
    nowFullAdOpen = true;
    lastAdTime = Date.now();

    sendYG('OpenInterAdv');

    if (typeof sdk !== 'undefined' && typeof sdk.showBanner === 'function') {
      sdk.showBanner();
      setTimeout(function () {
        nowFullAdOpen = false;
        sendYG('CloseInterAdv', 'true');
        FocusGame();
      }, 3000);
    } else {
      nowFullAdOpen = false;
      sendYG('CloseInterAdv', 'false');
      FocusGame();
    }
  } catch (e) {
    nowFullAdOpen = false;
    sendYG('ErrorInterAdv'); 
    sendYG('CloseInterAdv', 'false');
    FocusGame();
  }
}

function RewardedShow(id) {
  if (!canShowAd()) {
    sendYG('RewardUnavailable');
    sendYG('CloseRewardedAdv');
    return;
  }

  try {
    lastAdTime = Date.now();
    sendYG('OpenRewardedAdv'); 

    if (typeof sdk !== 'undefined' && typeof sdk.showBanner === 'function') {
      sdk.showBanner();
      setTimeout(function () {
        sendYG('RewardAdv', id);
        sendYG('CloseRewardedAdv', 'true');
        FocusGame();
      }, 3000);
    } else {
      sendYG('RewardAdv', id);
      sendYG('CloseRewardedAdv', 'true');
      FocusGame();
    }
  } catch (e) {
    sendYG('ErrorRewardedAdv');
    sendYG('CloseRewardedAdv', 'false');
    FocusGame();
  }
}

