function SetLeaderboard(name, score, extraData) {
  try {
    const key = 'lb_' + String(name || 'default');
    const val = Number(score) || 0;

    let best = 0;
    try { best = Number(localStorage.getItem(key) || '0'); } catch {}
    if (val > best) {
      try { localStorage.setItem(key, String(val)); } catch {}
    }
  } catch {}
}

